create table Clientes (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	ip_address VARCHAR(20)
);

SELECT * FROM Clientes WHERE email LIKE '%yahoo%' AND last_name LIKE 'S%';

SELECT COUNT(gender) FROM Clientes WHERE gender = 'Female';

SELECT * FROM Clientes WHERE gender = 'Male' AND ip_address LIKE '192.168%';

SELECT * FROM Clientes WHERE gender = 'Female';

SELECT * FROM Clientes WHERE (gender = 'Male' AND last_name = 'Smith') OR last_name = 'Johnson';

SELECT * FROM Clientes WHERE (id > 100 AND id < 200);

SELECT * FROM Clientes WHERE email LIKE '%gmail%';

SELECT * FROM Clientes WHERE (gender = 'Female' AND email LIKE '%yahoo%') OR last_name = 'Brown';
